import React from 'react'

const Innovation = (props:any) => {
  return (

<div className='mt-10'>
            <h1 className=' font-extrabold lg:text-5xl mb-2 text-center rounded-2xl border-gray-800 border-2 w-[50%] mx-auto p-2'>Publication</h1>
        <div className='max-w-[1240px] mx-auto px-4 pb-16 pt-6 grid sm:grid-clos-2 lg:grid-cols-3 gap-4'>
            

            <div className='relative'>
                <img src={props.bg} alt='/'/>
                <div className='bg-gray-900/30 absolute top-0 left-0 w-full h-full'>
                    <p className='left-4 bottom-4 text-2xl font-bold text-white absolute'>
                        {props.text}
                    </p>

                </div>
            </div>
            </div>
            </div>
        
    
  )
}
export default Innovation;
